import styled from "styled-components";

export const Container = styled.div`
  display: flex;
  justify-content: space-between;
  align-items: center;
  width: 100%;
  border: 2px solid #2072d7b3;
  background-color: white;
  border-radius: 10px;
  margin-bottom: 15px;
`;

export const Text = styled.div`
  margin-top: 15px;
  margin-bottom: 15px;
  padding-left: 25px;
  font-size: 20px;
`;
